// src/App.js
import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      {/* This div creates the red bar on the left */}
      <div className="left-red-bar">
        {/* Your Dashboard Button */}
        <button className="nav-button">Dashboard</button>
        {/* Your My Tasks Button */}
        <button className="nav-button">My Tasks</button>
        {/* Your new Task Categories Button */}
        <button className="nav-button">Task Categories</button> {/* Added new button */}
      </div>

      {/* This div will contain all your main application content */}
      <div className="main-content">
        <h1>My To-Do List</h1>
        <p>This is where your To-Do list content will appear.</p>
        <input type="text" placeholder="Add a new task..." />
        <button>Add Task</button>
      </div>
    </div>
  );
}

export default App;
